import './ExpensesList.css';

import ExpenseItem from './ExpenseItem';

const ExpensesList = propsFromList => {
    let expensesContent = <p>No expenses found.</p>

    if (propsFromList.items.length > 0) {
        expensesContent = propsFromList.itemsFromList.map((expense) => (
            <ExpenseItem
                // ultimately, in the absence of ID
                // index could be used but it is strongly discouraged
                key={expense.id}
                title={expense.title}
                price={expense.price}
                date={expense.date}
            />
        ))
    }
}

export default ExpensesList
